import React from 'react';

const Slide = ({ slides }) => {
  return (
    <section className={styles.container}>
      {slides.map(({ id, text }) => (
        <div key={id} className={styles.content}>{text}</div>
      ))}
      
    </section>
  );
};

export default Slide;
